import "react-datepicker/dist/react-datepicker.css";
import { useNavigate } from 'react-router-dom';
import Select from 'react-select'
const DetailStudy = () => {
    const navigate = useNavigate();
    const options = [
        { value: 'Permanent Resident', label: 'Permanent Resident' },
        { value: 'Doctoral Degree in Science, Business or Technology', label: 'Citizen' },
        { value: 'Visitor', label: 'Visitor' },
        { value: 'Work Visa', label: 'Work Visa' },
        { value: 'No Legal Status', label: 'No Legal Status' },
        { value: 'Other', label: 'Other' },
        { value: 'Student', label: 'Student' }
    ]
    return (
        
        <div className="sevenpage-container">
            <div style={{ fontSize: "20px", fontWeight: "600", paddingLeft: "10px" }}>Education history</div>
            <div className='status'>
                <span className='title-status'>Qualification</span>
                <Select options={options} className="select" />
            </div>
        </div>
    )
}
export default DetailStudy;
